keybindings:
{"keybindings":"// Place your key bindings in this file to override the defaults
[
    {
        "key": "shift+alt+cmd+right",
        "command": "workbench.action.splitEditorRight"
    },
    {
        "key": "ctrl+r",
        "command": "editor.action.rename",
        "when": "editorHasRenameProvider && editorTextFocus && !editorReadonly"
    },
    {
        "key": "shift+f6",
        "command": "-editor.action.rename",
        "when": "editorHasRenameProvider && editorTextFocus && !editorReadonly"
    },
    {
        "key": "alt+f1",
        "command": "workbench.files.action.toggleFileInExplorer"
    },
    {
        "key": "cmd+n",
        "command": "explorer.newFile"
    },
    {
        "key": "shift+cmd+n",
        "command": "explorer.newFolder"
    },
    {
        "key": "cmd+d",
        "command": "workbench.action.terminal.split",
        "when": "terminalFocus"
    },
    {
        "key": "ctrl+r",
        "command": "renameFile",
        "when": "explorerViewletVisible && filesExplorerFocus"
    },
    {
        "key": "shift+f6",
        "command": "-renameFile",
        "when": "explorerViewletVisible && filesExplorerFocus"
    },
    {
        "key": "cmd+0",
        "command": "terminal.open"
    },
    {
        "key": "ctrl+alt+o",
        "command": "-terminal.open"
    },
    {
        "key": "cmd+0",
        "command": "workbench.action.terminal.focusAtIndex1"
    },
    {
        "key": "shift+cmd+backspace",
        "command": "workbench.action.navigateToLastEditLocation"
    },
    {
        "key": "cmd+k cmd+q",
        "command": "-workbench.action.navigateToLastEditLocation"
    },
    {
        "key": "shift+cmd+n",
        "command": "scratchpads.newScratchpad",
        "when": "!filesExplorerFocus"
    },
    {
        "key": "alt+cmd+r",
        "command": "code-runner.run"
    },
    {
        "key": "ctrl+alt+n",
        "command": "-code-runner.run"
    },
    {
        "key": "ctrl+shift+cmd+w",
        "command": "workbench.action.closeAllEditors"
    },
    {
        "key": "cmd+k cmd+w",
        "command": "-workbench.action.closeAllEditors"
    },
    {
        "key": "ctrl+cmd+w",
        "command": "workbench.action.closeOtherEditors"
    },
    {
        "key": "cmd+d",
        "command": "compareSelected",
        "when": "filesExplorerFocus"
    },
    {
        "key": "cmd+b",
        "command": "editor.action.revealDefinition",
        "when": "editorHasDefinitionProvider && editorTextFocus && !isInEmbeddedEditor"
    },
    {
        "key": "f12",
        "lcommand": "-editor.action.revealDefinition",
        "when": "editorHasDefinitionProvider && editorTextFocus && !isInEmbeddedEditor"
    },
    {
        "key": "shift+cmd+b",
        "command": "editor.action.peekDefinition",
        "when": "editorHasDefinitionProvider && editorTextFocus && !inReferenceSearchEditor && !isInEmbeddedEditor"
    },
    {
        "key": "alt+f12",
        "command": "-editor.action.peekDefinition",
        "when": "editorHasDefinitionProvider && editorTextFocus && !inReferenceSearchEditor && !isInEmbeddedEditor"
    },
    {
        "key": "shift+alt+f7",
        "command": "editor.action.referenceSearch.trigger",
        "when": "editorHasReferenceProvider && editorTextFocus && !inReferenceSearchEditor"
    },
    {
        "key": "alt+cmd+f7",
        "command": "-editor.action.referenceSearch.trigger",
        "when": "editorHasReferenceProvider && editorTextFocus && !inReferenceSearchEditor"
    },
    {
        "key": "cmd+1",
        "command": "workbench.view.explorer"
    },
    {
        "key": "shift+cmd+e",
        "command": "-workbench.view.explorer"
    },
    {
        "key": "cmd+3",
        "lcommand": "workbench.view.scm"
    },
    {
        "key": "ctrl+shift+g",
        "command": "-workbench.view.scm"
    },
    {
        "key": "shift+alt+cmd+right",
        "command": "workbench.action.moveEditorToNextGroup"
    },
    {
        "key": "ctrl+cmd+right",
        "command": "-workbench.action.moveEditorToNextGroup"
    },
    {
        "key": "shift+alt+cmd+left",
        "command": "workbench.action.moveEditorToPreviousGroup"
    },
    {
        "key": "ctrl+cmd+left",
        "command": "-workbench.action.moveEditorToPreviousGroup"
    },
    {
        "key": "cmd+\\",
        "command": "editor.emmet.action.matchTag"
    },
    // {
    //   "key": "cmd+;",
    //   "command": "extension.aceJump",
    //   "when": "editorTextFocus"
    // },
    {
        "key": "cmd+;",
        "command": "extension.jumpy-word",
        "when": "editorTextFocus"
    },
    {
        "key": "Escape",
        "command": "extension.jumpy-exit",
        "when": "editorTextFocus && jumpy.isJumpyMode"
    },
    {
        "key": "alt+cmd+z",
        "command": "-git.revertSelectedRanges",
        "when": "editorHasSelection && editorTextFocus && !editorReadonly"
    },
    {
        "key": "alt+f12",
        "command": "-workbench.action.terminal.focus",
        "when": "!terminalFocus"
    },
    {
        "key": "alt+cmd+z",
        "command": "workbench.action.terminal.toggleTerminal"
    },
    {
        "key": "alt+f12",
        "command": "-workbench.action.terminal.toggleTerminal",
        "when": "terminalFocus"
    },
    {
        "key": "cmd+9",
        "command": "-workbench.view.scm"
    },
    {
        "key": "cmd+1",
        "command": "workbench.action.toggleSidebarVisibility"
    },
    {
        "key": "cmd+numpad9",
        "command": "workbench.view.scm"
    },
    {
        "key": "cmd+numpad9",
        "command": "-workbench.view.scm",
        "when": "editorFocus && workbench.scm.active"
    },
    {
        "key": "cmd+1",
        "command": "-workbench.view.explorer",
        "when": "editorFocus && viewContainer.workbench.view.explorer.enabled"
    },
    {
        "key": "cmd+1",
        "command": "-workbench.action.toggleSidebarVisibility",
        "when": "!editorFocus"
    },
    {
        "key": "cmd+9",
        "command": "-workbench.action.lastEditorInGroup"
    },
    {
        "key": "cmd+9",
        "command": "workbench.action.toggleSidebarVisibility"
    },
    {
        "key": "cmd+9",
        "command": "-workbench.action.toggleSidebarVisibility",
        "when": "!editorFocus"
    },
    {
        "key": "cmd+1",
        "command": "-workbench.action.focusFirstEditorGroup"
    },
    {
        "key": "ctrl+cmd+1",
        "command": "-workbench.action.moveEditorToFirstGroup"
    },
    {
        "key": "shift+cmd+down",
        "command": "-workbench.action.terminal.selectToNextCommand",
        "when": "terminalFocus && terminalHasBeenCreated || terminalFocus && terminalProcessSupported"
    },
    {
        "key": "shift+cmd+down",
        "command": "-cursorBottomSelect",
        "when": "textInputFocus"
    },
    {
        "key": "shift+cmd+down",
        "command": "editor.action.insertCursorBelow",
        "when": "editorTextFocus"
    },
    {
        "key": "alt+cmd+down",
        "command": "-editor.action.insertCursorBelow",
        "when": "editorTextFocus"
    }
]
","platform":1}

snippets:
{"snippets":{"Untitled.code-snippets":"{
  // Place your global snippets here. Each snippet is defined under a snippet name and has a scope, prefix, body and
  // description. Add comma separated ids of the languages where the snippet is applicable in the scope field. If scope
  // is left empty or omitted, the snippet gets applied to all languages. The prefix is what is
  // used to trigger the snippet and the body will be expanded and inserted. Possible variables are:
  // $1, $2 for tab stops, $0 for the final cursor position, and ${1:label}, ${2:another} for placeholders.
  // Placeholders with the same ids are connected.
  // Example:
  // "Print to console": {
  // 	"scope": "javascript,typescript",
  // 	"prefix": "log",
  // 	"body": [
  // 		"console.log('$1');",
  // 		"$2"
  // 	],
  // 	"description": "Log output to console"
  // }

  "reactHook": {
    "prefix": "rh",
    "body": [
      "import React, { useState } from 'react'",
      "",
      "export default function ${1:${TM_FILENAME_BASE}}() {",
      "  return (",
      "    <div>",
      "      $0",
      "    </div>",
      "  )",
      "}",
      ""
    ],
    "description": "Creates a React Functional Component with ES7 module system"
  },
  "surround": {
    "prefix": "surround",
    "body": ["    <foo>", "      ${TM_SELECTED_TEXT}", "    </foo>"],
    "description": "Creates a React Functional Component with ES7 module system"
  }
}
"}}
